import React from 'react'
import styled from 'styled-components'

const StyledForm = styled.form`
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 30vw;
  border: 1px solid black;
  border-radius: 10px;
  padding: 10px;
`;

const Form = ({ children }) => {
  return (
    <StyledForm>
      {children}
    </StyledForm>
  )
}

export default Form
